  id SERIAL PRIMARY KEY,
  cpf VARCHAR(14) NOT NULL,
  epoch BIGINT NOT NULL,
  data_coleta TIMESTAMP NOT NULL,
  ind_pulm NUMERIC(6,5) NOT NULL,
  paciente_id INTEGER NOT NULL,
